      <div className="wrapper">
        <h1>FORM</h1>
        <div className="form-input">
            <input type="text" id="input" placeholder="please input username"/>
            <button type="button" onclick={() => {}} id="button">submit</button>
        </div>
        <div id="result">
          {state.map((value, index) => {
              return <div key ={index} style={{color: "blue"}}>{value}</div>;
          })}
        </div>
    </div>
    </div>
  );
}

export default App;
